import{_ as a,a as o}from"./chunks/1647583375429-24557335-2b92-4ae3-9e1f-b18d161e759c.CfBh4LNn.js";import{_ as e}from"./chunks/1647583362060-8b85c2e1-bb4d-4ab0-9d2f-260279085466.Bi0BoRuc.js";import{_ as n,c as s,a0 as r,o as i}from"./chunks/framework.CMtr6uOw.js";const c="/assets/1647583375504-bdb6a7ea-ead4-4f3e-9df8-ad5277c04918.CttWc8vA.png",l="/assets/1647583375579-99445bd3-70a2-4d2f-b86f-fb1d3a930ddc.Df7E1TFZ.png",d="/assets/1647583375654-4708939a-2ad5-4698-9bdf-ae25f0a3e16f.D2dXnA4K.png",p="/assets/1647583375730-311368a4-2cc5-46ab-8062-1834d57e0156.INS_8OHN.png",h="/assets/1647583375819-ed6f9565-b131-4e16-a009-3bf8551c959a.CP-r2iS0.gif",u="/assets/1647583375935-9bdf5e0e-e701-4952-97cb-bed874aecbe5.BFIpOO9p.png",g="/assets/1647583376014-e2f39351-fa8b-434c-a501-0759addbbc2d.CxBQZ03k.png",m="/assets/1647583376093-c5873fd8-193a-427d-a525-e890cbaa6ede.Dwvf16Oz.gif",b="/assets/1647583376180-12dae999-b4ea-42a0-9a24-f2af189df97a.61R22aZl.png",R=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"en/2-researcher-manual/1-4-data-manage-projects.md","filePath":"en/2-researcher-manual/1-4-data-manage-projects.md"}'),w={name:"en/2-researcher-manual/1-4-data-manage-projects.md"};function f(y,t,v,q,j,P){return i(),s("div",null,t[0]||(t[0]=[r('<h2 id="project-data-management" tabindex="-1">Project Data Management <a class="header-anchor" href="#project-data-management" aria-label="Permalink to &quot;Project Data Management &lt;!-- {docsify-ignore-all} --&gt;&quot;">​</a></h2><p>Click the &quot;<strong>Download Data</strong>&quot; button in the project list to enter the project data download page.</p><p>If you cannot directly see buttons like &quot;<strong>Canvas</strong>&quot;, &quot;<strong>Download Data</strong>&quot;, etc., it may be because your device&#39;s screen is too narrow. Simply scroll right to find them.</p><p><img src="'+a+'" alt=""></p><p><img src="'+e+'" alt=""></p><p><img src="'+o+'" alt=""></p><h2 id="official-platform-paid-survey-publication-type" tabindex="-1">Official Platform (Paid Survey) Publication Type <a class="header-anchor" href="#official-platform-paid-survey-publication-type" aria-label="Permalink to &quot;Official Platform (Paid Survey) Publication Type&quot;">​</a></h2><h3 id="pending-review-section" tabindex="-1">Pending Review Section <a class="header-anchor" href="#pending-review-section" aria-label="Permalink to &quot;Pending Review Section&quot;">​</a></h3><h4 id="answer-status" tabindex="-1">Answer Status <a class="header-anchor" href="#answer-status" aria-label="Permalink to &quot;Answer Status&quot;">​</a></h4><p>Each data record has three possible <strong>answer statuses</strong>: Valid, In Progress, and Abandoned.</p><ul><li><strong>Valid</strong> status means the participant has completed the project normally and submitted data.</li><li><strong>In Progress</strong> status means the participant is currently doing the project.</li><li><strong>Abandoned</strong> status means the participant actively quit the project during participation.</li></ul><p><img src="'+c+'" alt=""></p><blockquote><p>【Tips】</p><p>A <strong>Valid</strong> answer status does not indicate the quality of the data.</p><p>Note that once a participant abandons the test during the process, Naodao will automatically <strong>reject</strong> that participant&#39;s data record. This means Naodao automatically reviews these abandoned data records, so they won&#39;t appear in the <strong>Pending Review</strong> section but will automatically appear in the <strong>Reviewed</strong> section.</p></blockquote><h4 id="data-acceptance" tabindex="-1">Data Acceptance <a class="header-anchor" href="#data-acceptance" aria-label="Permalink to &quot;Data Acceptance&quot;">​</a></h4><p>When a participant completes a project, their test record appears in the <strong>Pending Review</strong> section of the [Download Data] page. All test data in the <strong>Pending Review</strong> section has not yet been reviewed by the project publisher.</p><p><img src="'+l+'" alt=""></p><p>You can <strong>accept</strong> participant data based on their performance on <strong>check questions</strong> (using metrics like accuracy or response time). Note that data with an <strong>In Progress</strong> status cannot be accepted or rejected!</p><p>Accepted data appears in the <strong>Reviewed</strong> section with a <em>Accepted</em> <strong>review status</strong>. You can download accepted data or click the <strong>Details</strong> button in the [Operations] column to view the participant&#39;s responses.</p><blockquote><p>【Tips】Clicking the <strong>Details</strong> button in the <strong>Reviewed</strong> section only shows responses to questionnaire-type items (personal information, questionnaires, test environment), not experimental response information (which must be downloaded manually).</p></blockquote><p>Note that you cannot view <strong>unaccepted</strong> participant data. Once you accept participant data in the <strong>Pending Review</strong> section, the system assumes you have obtained the participant&#39;s data, meaning you cannot change the review status from <strong>Accepted</strong> to <strong>Unaccepted</strong>.</p><h4 id="data-rejection" tabindex="-1">Data Rejection <a class="header-anchor" href="#data-rejection" aria-label="Permalink to &quot;Data Rejection&quot;">​</a></h4><p>If you believe a participant did not complete the test seriously or submitted malicious responses, you can use the [Reject] button to not accept their data.</p><blockquote><p>【Tips】Please don&#39;t arbitrarily reject participant data! Doing so may lead to complaints about your published project. Generally, for project complaints, Naodao first lets participants communicate with you privately via <strong>internal messages</strong>. If communication fails, Naodao platform will intervene and judge the reasonableness of the complaint based on evidence from both parties. Note that if your published project receives a certain number of complaints, Naodao platform will temporarily remove your project.</p></blockquote><p>Rejected data also appears in the <strong>Reviewed</strong> section with an <em>Unaccepted</em> <strong>review status</strong>. Unaccepted data cannot be selected for download.</p><p><img src="'+d+'" alt=""></p><p>Rejected data can be <strong>accepted again</strong>, but this usually occurs after effective private communication with the participant. In other words, the system allows you to re-accept previously rejected participant data. Note that after second acceptance, you cannot reject that participant&#39;s data again.</p><h4 id="system-automatic-review" tabindex="-1">System Automatic Review <a class="header-anchor" href="#system-automatic-review" aria-label="Permalink to &quot;System Automatic Review&quot;">​</a></h4><p>&amp;&gt; ⚠️ To avoid accepting unnecessary data, please review promptly.</p><p>The acceptance and rejection described above usually require manual operation by researchers. However, to protect participant rights, the deadline for manual review is within <strong>72 hours</strong> of completion.</p><p>If no manual review occurs within this period, <strong>system automatic review</strong> will be triggered. The system will determine whether to pass based on the <a href="/2-researcher-manual/1-1-6-publish-project.html#验证错题数">check question threshold</a> set during questionnaire publication: when check question errors are <strong>less than</strong> the threshold, the system will approve; conversely, if <strong>greater than or equal to</strong> the threshold, the system will reject. If no check questions are set, the system will <strong>default to pass</strong>.</p><h4 id="batch-accept-reject" tabindex="-1">Batch Accept/Reject <a class="header-anchor" href="#batch-accept-reject" aria-label="Permalink to &quot;Batch Accept/Reject&quot;">​</a></h4><p>When there is more than one response record in the <strong>Download Data</strong> section, you can accept and reject data in <strong>batch</strong>.</p><p>You can click the <strong>Select All</strong> button to select all response records, or use <strong>individual checkboxes</strong> to select desired records. Both methods will activate the [Batch Accept] and [Batch Reject] buttons.</p><p><img src="'+p+'" alt=""></p><p><img src="'+e+'" alt=""></p><p><img src="'+h+'" alt=""></p><h3 id="reviewed-section" tabindex="-1">Reviewed Section <a class="header-anchor" href="#reviewed-section" aria-label="Permalink to &quot;Reviewed Section&quot;">​</a></h3><p>All reviewed data records appear in the <strong>Reviewed</strong> section.</p><h4 id="review-status" tabindex="-1">Review Status <a class="header-anchor" href="#review-status" aria-label="Permalink to &quot;Review Status&quot;">​</a></h4><p>Each data record has two possible <strong>review statuses</strong>: <em><strong>Accepted</strong></em> and <em><strong>Unaccepted</strong></em>. Self-explanatorily, <strong>Accepted</strong> means data accepted by the project publisher, <strong>Unaccepted</strong> means data rejected by the project publisher.</p><h4 id="download-all-selected-data" tabindex="-1">Download All/Selected Data <a class="header-anchor" href="#download-all-selected-data" aria-label="Permalink to &quot;Download All/Selected Data&quot;">​</a></h4><p>You can download all data with <strong>Accepted</strong> review status in the <strong>Reviewed</strong> page.</p><blockquote><p>Unaccepted data cannot be downloaded.</p></blockquote><p>You have two ways to download data:</p><ul><li>Download all data</li></ul><p>You can directly click the [Download All Data] button to automatically download all accepted data records.</p><p><img src="'+u+'" alt=""></p><p><img src="'+e+'" alt=""></p><p><img src="'+g+'" alt=""></p><p><strong>Data Format</strong>: You can choose to download <code>csv file</code> or <code>excel file</code></p><blockquote><p>Currently only supports downloading <code>csv files</code></p></blockquote><ul><li>Download selected data</li></ul><p>You can use <strong>individual checkboxes</strong> to select desired data records. This method will activate the [Download Selected Data] button.</p><p><img src="'+m+'" alt=""></p><h2 id="anonymous-publication" tabindex="-1">Anonymous Publication <a class="header-anchor" href="#anonymous-publication" aria-label="Permalink to &quot;Anonymous Publication&quot;">​</a></h2><p>Naodao automatically accepts all anonymous data, so you don&#39;t need to accept it manually. Therefore, the [Download Data] page for anonymous data has no <strong>Pending Review</strong> and <strong>Reviewed</strong> sections.</p><p>For an anonymous project, Naodao defaults to downloading all anonymous data each time, and currently doesn&#39;t support downloading <strong>selected data</strong>.</p><p><img src="'+b+'" alt=""></p><h2 id="other-tutorials" tabindex="-1">Other Tutorials <a class="header-anchor" href="#other-tutorials" aria-label="Permalink to &quot;Other Tutorials&quot;">​</a></h2><p><a href="https://mp.weixin.qq.com/s/RVgvSqqBYg0JVzjPYyc7BA" target="_blank" rel="noreferrer">Master Project Publication Management and Data Management Easily</a></p>',60)]))}const A=n(w,[["render",f]]);export{R as __pageData,A as default};
